.approvalInfos {
    height: calc(100vh - 135px);
    background: #fff;
    margin: 0 16px 16px 16px;
    padding: 16px;
    border-radius: 8px;
    overflow: hidden;
    position: relative;
    .condition {
        display: flex;
        justify-content: space-around;

        .el-input {
            width: 120px;
        }
        .el-select {
            width: 120px;
        }
        .el-button {
            border-radius: 6px;
            background: #84C22E;
            color: #fff;
            margin: 0;
        }

    }
    @import "./style.scss";
    // 表格
    .el-table {
        margin-top: 0px;
    }
    // 分页
    .pagination {
        position: absolute;
        bottom: 10px;
        right: 20px;
        // height: 64px;
        display: flex;
        align-items: center;
        flex-direction: row-reverse;
        .el-pagination {
            margin: 0;
        }
    }

}
